import React, { Component } from 'react';
import Forms from './Components/Forms';
import Navibar from './Components/Navibar';
import Login from './Components/Login';

class App extends Component {

  render() {
    return (
      <div>
      <Navibar />
      <Forms />
      <Login />
      </div>
    );
  }
}

export default App;
